    //formats data into HTML so page can display it
    let pokeFormatted = data.pokemon.map((pokemon) => {
        return (
            <div className='col-sm-3'>
                <h3><a href={`/mockmon/${pokemon.id}`}>
                    {pokemon.species}
                </a></h3>
                <img src={pokemon.image} alt={pokemon.name}></img>
